import ViewMainBook from "./ViewMainBook";

const style = {
    box: {
        width: '152px',
        height: '215px',
    },
    img: {
        width: '152px',
        height: '215px'
    }
}

function ViewMainList(props) {

    return (
        <div className={'container my-5'}>
            <div>
                <span>'?' 검색결과 총 ?개</span>
            </div>
            <ViewMainBook />
            <ViewMainBook />
            <ViewMainBook />
            <ViewMainBook />
            <ViewMainBook />
        </div>
    )
}

export default ViewMainList;
